window.bookSummaryJSON = "<p><b>Jonathan Grave pursues two missing teens south of the border - where vengeance awaits....</b></p> <p>El Paso, Texas, is a battleground. It's an open market for Mexican drug cartels to sell their wares. It's also a destination for teens looking for fun. Venice Alexander's 14-year-old son Roman was there on a school trip. Now, he and a fellow student have vanished without a trace.</p> <p>Assuming the kidnapping is retaliation for his past incursions against Mexico's underworld, Jonathan Grave leads his covert operatives to rescue their teammate's son. But the trail Jonathan follows leads him down unexpected paths, where he ends up in the crossfire of a deadly vendetta....</p>"; 
